import React from 'react';
import { Button } from 'antd';
import styled from 'styled-components';


const closeBtn = styled(Button)`
    width: 100%
`;

const DetailPost = ({ onClose }) => {
    return (
        <>
        <closeBtn onClick={onClose}>닫기</closeBtn>
        
        </>
        
    );
};

export default DetailPost;
